def sum_of_primes(n):
    primes = [True] / (n + 1)
    primes[0] = primes[1] = False
    p = 2
    while p * p <= n:
        if primes[p]:
            for i in range(p * p, n + 1, p):
                primes[i] = False
        p += 1
    return sum((i for i in range(2, n + 1) if primes[i]))

